import logo from './logo.svg';
import React, {Component} from 'react';
//import './App.css';
import {AppBar, Toolbar} from "@material-ui/core"
import FilteredList from "./FilteredList";
import DellPhone from "./pomegranate.jpg";
import MDesktop from "./mango.jpg";
import ADesktop from "./Orange.jpg";
import STablet from "./kiwi.jpg";
import MTablet from "./rambuttan.jpg";
import APhone from "./raspberry.jpg";
import MPhone from "./apple.jpg";


const produce = [
  { name: "pomegranate", size: "Medium", type: "berry", img: DellPhone, rating: 4, icon:   <button class="btn"><div  style={{color: 'blue'}}>

      </div></button>},
  { name: "Orange", size: "Medium", type: "Desktop", img: MDesktop, popularity: 6, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Apple", size: "Small", type: "Desktop", img: ADesktop, popularity: 4, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Kiwi", size: "Small", type: "Tablet", img: STablet, popularity: 3, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rasberry", size: "Small", type: "Tablet", img: MTablet, popularity: 5, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Rambutaan", type: "Small", size: "Apple" ,img: APhone, popularity: 2, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Coconut", size: "Large", type: "Phone", img: MPhone, popularity:7, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "papaya", size: "Large", type: "Laptop", img: MPhone, popularity:8, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Mango", size: "Large", type: "Laptop", img: MPhone,popularity:9, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Lime", size: "Small", type: "Tablet", img: MPhone, popularity:11, icon:   <div style={{color: 'blue'}}>

      </div>},
  { name: "Fig", size: "Small" ,type: "Laptop", img: MPhone, popularity:10, icon:   <div style={{color: 'blue'}}>
      </div>},
  { name: "Apricot", size: "Medium", type: "Laptop", img: MPhone ,popularity:1, icon:   <div style={{color: 'blue'}}>

      </div>}
];

class App extends Component {
  render() {
    return (
      <div className="App">

        <FilteredList items = {produce}/>
      </div>
    );
  }
}

export default App;
